import React from 'react';
import Card from './Card.js';
import '../css/App.css';

export default class SetTable extends React.Component {

    render() {
        return(
            <div className="gameDeck">
                {this.props.tableShow.map((curCard)=><Card key={curCard.id} id={curCard} color={curCard.color} shape={curCard.shape} shading={curCard.shading} num={curCard.num} select={curCard.selectStatus}></Card>)}
            </div>
        )
    }
}
